pragma solidity ^0.6.12;




contract BusdMigrator is Ownable { 
    address public router = 0x05E61E0cDcD2170a76F9568a110CEe3AFdD6c46f;
    address public pancakeRouter = 0x10ED43C718714eb63d5aA57B78B54704E256024E;
    address public constant BUSD = 0xe9e7CEA3DedcA5984780Bafc599bD69ADd087D56; 
    address public constant USDT = 0x55d398326f99059fF775485246999027B3197955;
    address public constant WBNB = 0xbb4CdB9CBd36B01bD1cBaEBF2De08d9173bc095c;
    
    address[] path = [BUSD, WBNB, USDT];
    uint256 public routerDeadlineDuration = 300;

    event Migrated(address indexed lpToken, uint256 liquidity);

    constructor() public {
        _approveTokenIfNeeded(BUSD, pancakeRouter, type(uint).max);
    }

    function setRouter(address _router) public onlyOwner {
        require(_router != address(0), "Cannot set router address to zero");
        router = _router;
    }

    function approveBUSD() external onlyOwner {
        _approveTokenIfNeeded(BUSD, pancakeRouter, type(uint).max);
    }

    function migrate(
        address lpToken,
        uint256 liquidity
    ) public { 

        // Step 1 : remove liquidity for lp tokens
        address tokenA = ILP(lpToken).token0();
        address tokenB = ILP(lpToken).token1();
        require(BUSD == tokenA || BUSD == tokenB, "One of the tokens must be BUSD");
        require(liquidity > 0, "Zero liq.");

        ILP(lpToken).transferFrom(msg.sender, address(this), liquidity);
        if (ILP(lpToken).allowance(address(this), router) < liquidity) {
            ILP(lpToken).approve(router, liquidity);
        }
        IPancakeRouter02(router).removeLiquidity(       
            tokenA,
            tokenB,
            liquidity,
            1,
            1,
            address(this),
            now + routerDeadlineDuration
        );
    
        // Step 2 : swap BUSD to USDT
        uint256 amountIn = IERC20(BUSD).balanceOf(address(this));
        IPancakeRouter02(pancakeRouter).swapExactTokensForTokens(
            amountIn,
            0,
            path,
            address(this), 
            now + routerDeadlineDuration
        ); 

        uint USDTAmount = IERC20(USDT).balanceOf(address(this));

        // Step 3 : add liquidity for the USDT pair
        address other = tokenA != BUSD ? tokenA : tokenB;
        uint256 otherAmount = IERC20(other).balanceOf(address(this));

       _approveTokenIfNeeded(other, router, otherAmount);
       _approveTokenIfNeeded(USDT, router, USDTAmount);

        IPancakeFactory factory = IPancakeFactory(IPancakeRouter02(router).factory()); 

        address pairAdd = factory.getPair(other,USDT);

        if (pairAdd == address(0)) {
            pairAdd = factory.createPair(other, USDT);
        }

        IPancakeRouter02(router).addLiquidity(
            other,
            USDT,
            otherAmount,
            USDTAmount,
            1,
            1, 
            address(this),
            now + routerDeadlineDuration
        );
        uint256 lpBalance = ILP(pairAdd).balanceOf(address(this));
        ILP(pairAdd).transfer(msg.sender, lpBalance);

        // transfer dust balance to user
        uint busdBal = IERC20(BUSD).balanceOf(address(this));
        uint usdtBal = IERC20(USDT).balanceOf(address(this));
        uint otherBal = IERC20(other).balanceOf(address(this));
        
        if (busdBal > 0) {
            IERC20(BUSD).transfer(msg.sender, busdBal);
        }
        if (usdtBal > 0) {
            IERC20(USDT).transfer(msg.sender, usdtBal);
        }
        if (otherBal > 0) {
            IERC20(other).transfer(msg.sender, otherBal);
        }
        
        emit Migrated(lpToken, liquidity);
    }

    function _approveTokenIfNeeded(address token, address _routerAddress, uint256 amount) private {
        if (IERC20(token).allowance(address(this), _routerAddress) < amount) {
            IERC20(token).approve(_routerAddress, amount);
        }
    }

    function extractStuckTokens(address _token) external onlyOwner {
        uint bal = IERC20(_token).balanceOf(address(this));
        if (bal >0) {
            IERC20(_token).transfer(msg.sender, bal);
        }
    }
}
